import './App.css';
import Login from './App/Components/Login/Login';
import history from './App/Components/history';
import { Router, Switch, Route, Redirect } from 'react-router-dom'
function App() {
  function loginuser() {
    return (
      <Switch>
        <Route>
          <Redirect to="/login" />
          <Login />

        </Route>
      </Switch>)
  }
  return (<Router history={history}>

    <div className="App">
      {loginuser()}
    </div>
  </Router>

  );

}

export default App;
